function closeCloudView() {
    var $player_container = $("#intro-player");
    $player_container.fadeOut();
    $('#player_div').empty();

}


function showplay(obj){
	$(obj).find('.play').show();
	$(obj).find('dt').addClass('translayer');
}
function hideplay(obj){
	$(obj).find('.play').hide();
	$(obj).find('dt').removeClass('translayer');
}
